import React from 'react';
import axios from 'axios';
import Moment from 'react-moment';
import 'moment/locale/sl';
import 'moment-timezone';

export default class List extends React.Component {
    state = {
        items: []
    }


    componentDidMount() {
        axios.get(process.env.REACT_APP_BASE_URL + '/api/data')
        .then(res => {
            const items = res.data.data;
            this.setState({items});
        });
    }

    render() {
        return (
            <div className="list">
                <div className="list__head">
                    <div>Dr≈æava</div>
                    <div>Smrti</div>
                    <div>Potrjenih primerov</div>
                    <div>Okrevanih pacientov</div>
                    <div>Posodobljeno</div>
                </div>
                <div className="items">
                    {this.state.items.map(item => 
                        <div className="item">
                            <span className="item__state">
                            <span>{item.region}</span> {item.state.length > 0 && <span>{item.state}</span>}
                            </span>
                            <span className="item__deaths">{item.deaths}</span>
                            <span className="item__confirmed">{item.confirmed}</span>
                            <span className="item__recovered">{item.recovered}</span>
                            <span className="item__date"><Moment fromNow locale="sl">{item.last_update}</Moment></span>
                        </div>
                    )}
                </div>
            </div>
        )
    }
}
